  return (
  <Page>
    <Grid sx={{ flexGrow: 1 }} container spacing={2}>
      <Grid item xs={12}>
        <Grid container justifyContent="center" spacing={2}>
          {[0, 1, 2].map((value) => (
            <Grid key={value} item>
              <Paper sx={{ height: "100%", width: "33%" }} />
            </Grid>
          ))}
        </Grid>
      </Grid>
    </Grid>
  </Page>
  );
};

export default MainPage;
